(11, 'HomeSliderText', 'Home Slider Text', 'Colabs Outlets - Free rental of 28 days during  Movement Control Order (\"MCO\") for existing tenants. Tenancy will be extended for a month to support Startups & SMEs during this challenging time.\r\n<br>\r\nFree company incorporation if you sign up for company secretarial support for 2 years\r\n<br>\r\nMonthly accounting services starting as low as RM200 per month'),
(12, 'ServiceForm', 'Service Form', 'Accounting Services\r\n- Initial set up of accounting system and database\r\n- Monthly bookkeeping service\r\n- Processing of monthly payment for vendors\' invoices\r\n- Preparation of tax invoices(SST)\r\n- Generation and payment facilitation of SST Return\r\n- Year-end activity - Liaison with auditors and tax agent\r\n- Freelance bookkeeper on site or off site (monthly/quarterly, yearly)\r\n- Storage\r\n\r\nAudit\r\n- Annual audit\r\n\r\nValuation\r\n- Company valuation\r\n\r\nTaxation Services\r\n- Expatriate tax compliance & advisory\r\n- SST Services\r\n- Corporate income tax compliance & advisory\r\n\r\nHuman Resource Services\r\n- Payroll Services\r\n- Immigration Services\r\n\r\nCompany Secretarial Services\r\n- Company Incorporation\r\n- Post Incorporation Corporate Secretarial Services\r\n- Business licence application\r\n- Event space\r\n- Stationery - Company Stamp, Company Seal\r\n\r\nLegal\r\n- Shareholders\' Agreement\r\n- Joint Venture Agreement\r\n- Partnership Agreement\r\n- Distribution Agreement\r\n- Franchise Agreement\r\n- Share Sale Agreement\r\n- Investment Agreement\r\n- Subscription Agreement\r\n- License and Services Agreement\r\n- Marketing Agency Agreement\r\n- Intercompany Loan Agreement\r\n- Stakeholder Agreement\r\n- Non-disclosure Agreement\r\n- Underwriting Agreement\r\n- Other commercial agreements\r\n- Trademark registration\r\n\r\nDigital Marketing and SEO\r\n- Website Audit (Analysis on the website based on google searching criterias)\r\n- In-depth Website Studies (Analysis on the structure of the website)\r\n- Keyword Research (Analyse google search keywords for your business)\r\n- Content Creation(Content ideation and write-up)\r\n- Custom Image/Photographs (employee photos, company logo, service photo, office photo and infographics)\r\n- Custom Videos\r\n\r\nWebsite Creation\r\n- Website Hosting and Domain (hosting setup on AWS cloud, domain acquisition and SSL Website protection)\r\n-Website Service (Wordpress CMS installation)\r\n- Wordpress Backend Setup (Divi website builder, Plugins, Backup Installation)\r\n- Website Design -Non-ecommerce (Design mock-up, Homepage, about & Contact page, Service pages, API installation, Internal links.)\r\n- Website Design -E-commerce/ Marketplace\r\n\r\nGraphic Design\r\n- Logo\r\n- Name Cards\r\n- Flyers\r\n- Leaflets\r\n- Banner/Buntings\r\n- Small Stickers\r\n- Product Label\r\n- LetterHead\r\n- Catalogue(Each page)\r\n- Menu Book(Each page)\r\n- Menu sheet\r\n- Paper Bag\r\n- Folder\r\n- Bill Book'),
